import React from "react";

const FileUpload = ({ onFileChange, onFileUpload }) => {
  return (
    <div>
      <h2>Upload File</h2>
      <input type="file" onChange={onFileChange} />
      <button onClick={onFileUpload}>Upload File</button>
    </div>
  );
};

export default FileUpload;
